import Navbar from './components/Navbar.js';

export class Root extends React.component {

	render(){
		return(
			<div className="container">
			<div className="row">
			<Navbar />
			</div>
			<div className="row">
			{this.props.children}
			</div>
			</div>
			);
	}
}
